		if($this->db->count_all('counties')==0){
			$this->counties_tables();
		}
		
		if($module=='voter_turnout'){
			if($this->voter_turnout_tables())
			{
				return true;
			}else{
				return false;
			}
		}
		if($module=='aspirants'){
			if($this->aspirants_tables())
			{
				return true;
			}else{
				return false;
			}
		}
	}
	
	public function is_installed($module){
		$this->db->select('*');
		$this->db->from('modules');
		$this->db->where("name", $module);
		
		$result = $this->db->get();
		$result = $result->result_array();
		
		$installed = $result[0]['sampledata'];
		
		if($installed=='1'){
			return true;
		}else{
			return false;
		}
	}
